import React from 'react'
import { useEffect, useState, useContext, createContext } from 'react';
import axios from 'axios';
import { BASEURL } from './baseURL';
import DoctorList from './DoctorList';
import { AppContext } from './App';
import DoctorDetailsCard from './DoctorDetailsCard';

export const PatientContext = createContext();

function PatientHomePage() {

    const {id, patientId, setPatientId} = useContext(AppContext);
    const [chosenDoctor, setChosenDoctor] = useState(0);

    

    useEffect(()=>{
        const profileDetails = async() =>{
            try {
                const response = await axios.get(BASEURL + `/profile/patient_profile_details/${id}`);
                console.log(response);
                setPatientId(response.data["id"]);
            } catch(error){
                console.error(error);
            }};
            profileDetails();
        }, [])
    

  return (
    <AppContext.Provider value = {{chosenDoctor, setChosenDoctor}}>
        <div>
        PatientHomePage
        <DoctorList 
            chosenDoctor = {chosenDoctor}
            setChosenDoctor = {setChosenDoctor}/>
            <DoctorDetailsCard />
        </div>
        
    </AppContext.Provider>
  );
}

export default PatientHomePage
